('1601','6','7447','Reiheneckhaus Ziegler',Null,'Gepflegtes Reiheneckhaus mit Meerblick direkt über Port Adriano','15795','Mit Blick über den renovierten und teilweise neu erstellten Jachthafen von Port Adriano, steht dieses gepflegte zweigeschossige Reiheneckhaus.\r\nDie ca. 180 m² Wohnfläche verteilt sich auf 2 Etagen. Im Erdgeschoss befinden sich eine moderne, offene Küche und das Wohn-Esszimmer mit Zugang zum privaten Garten und ein Gäste-WC. Im Obergeschoss liegen das Hauptschlafzimmer mit Terrasse und Badezimmer en Suite, sowie ein 2. Schlafzimmer mit Badezimmer. Im Untergeschoss liegen die Tiefgarage mit Platz für 2 PKW sowie ein Kellerraum von ca. 20 m². Es besteht die Möglichkeit zwei weitere Schlafzimmer zu schaffen.\r\nZur Ausstattung gehören eine Klimaanlage w/k, Kamin,  Marmorheizung, Einbauschränke, Tel-. Internet- und SAT-Anschlüsse.\r\nDie Gemeinschaftseinrichtung bietet 2 Indoor Squashplätze, ein Tischtennisraum, eine Sauna, ein Fitnessraum und 2 Außenpools.','15796','925000','111','2011-07-29 14:41:34','106','2011-07-29 14:44:47','1600','1037','89','517',1,'1','0',Null,Null,Null,'15797',Null,'0','0','0',Null,'2015-11-11 13:35:37',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'15798',Null,'15799',Null,'15800',Null,'15801',Null,'15802','0',0,'0');
